import React from "react";

function Navbar() {
  let Links = [
    { name: "ABOUT", link: "/" },
    { name: "PROJECTS", link: "/" },
    { name: "CONTACT", link: "/" },
  ];
  return (
    <div className="w-full fixed flex items-center justify-between">
      <div className="text-2xl text-white font-merriweather">
        <a href="/">BARA KHARSEH</a>
      </div>
      <ul className="text-white font-merriweather flex items-center">
        {Links.map((link) => (
          <li className="ml-8 text-xl">
            <a href={link.link} className="hover:text-gray-400 duration-300">{link.name}</a>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Navbar;
